public class InnerPluginPluginAuthConfigurationFactory(Action<Humidifier.QBusiness.PluginTypes.PluginAuthConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.QBusiness.PluginTypes.PluginAuthConfiguration>
{

    internal InnerPluginBasicAuthConfigurationFactory BasicAuthConfigurationFactory { get; set; }

    internal InnerPluginOAuth2ClientCredentialConfigurationFactory OAuth2ClientCredentialConfigurationFactory { get; set; }

    protected override Humidifier.QBusiness.PluginTypes.PluginAuthConfiguration Create()
    {
        var pluginAuthConfigurationResult = CreatePluginAuthConfiguration();
        factoryAction?.Invoke(pluginAuthConfigurationResult);

        return pluginAuthConfigurationResult;
    }

    private Humidifier.QBusiness.PluginTypes.PluginAuthConfiguration CreatePluginAuthConfiguration()
    {
        var pluginAuthConfigurationResult = new Humidifier.QBusiness.PluginTypes.PluginAuthConfiguration();

        return pluginAuthConfigurationResult;
    }
    public override void CreateChildren(Humidifier.QBusiness.PluginTypes.PluginAuthConfiguration result)
    {
        base.CreateChildren(result);

        result.BasicAuthConfiguration ??= BasicAuthConfigurationFactory?.Build();
        result.OAuth2ClientCredentialConfiguration ??= OAuth2ClientCredentialConfigurationFactory?.Build();
    }

} // End Of Class

